import './App.css';
import {Button} from 'react-bootstrap';
import LoginForm from "./components/loginform";

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello World</h1>
        <Button>Aceptar</Button>
      </header>
    </div>
  );
}

export default App;
